import React, { useState} from 'react'





function App() {
  const [todos, setTodos] = useState ({ id: 1, name: "Todo 1", complete : false})
  return (
    <>
    <Todolist todos={todos}/>
    <input type="text"/>
    <button>Add your Todo</button>
    <button>Todo done</button>
    <div>0 left</div>
    </>


  );
}

export default App;
